// src/components/ProgressBar.js
import React from 'react';
import '../css/ProgressBar.css'; // Assuming you have a CSS file for styling

const ProgressBar = ({ progress, totalCards }) => {
  // Calculate milestone percentages
  const milestones = [25, 50, 75]; // Example milestones: 25%, 50%, 75%
  const milestoneMarkers = milestones.map((milestone) => (
    <div
      key={milestone}
      className="milestone-marker"
      style={{ left: `${milestone}%` }}
    />
  ));

  return (
    <div className="progress-bar-container">
      <div className="progress-bar" style={{ width: `${progress}%` }}>
        <div className="milestones">{milestoneMarkers}</div>
        {progress}%
      </div>
    </div>
  );
};

export default ProgressBar;
